import React from 'react';
import s from './Portfolio.module.css';
const Portfolio = ()=>{
    let settings = {
        dots:false,
        infinite:true,
        slideToShow:1,
        slideToScroll:1,
        arrows:false,
        centerMode:true,
        centerPadding:'82px'
    };
    return(
<Slider {...settings} className={s.portfolioSlider}>
<div>
    <img src={review1}></img>
</div>
<div>
<img src={review2}></img>
</div>
<div>
<img src={review3}></img>
</div>
<div>
<img src={review4}></img>
</div>
</Slider>
    );
};

export default Portfolio;
